import React from 'react'

function TextBox(props) {
    return (
    <div>
        <label htmlFor={props.label + ": "}>{props.label + ": "}</label>
    {props.focus ? (
        <input className=""
        type={"text"} 
        autofocus
        label={props.label} 
        required 
        value={props.value}
        onChange={(e) => props.change(e.target.value)} 
        />
    ) : (
        <input className=""
        type={"text"} 
        label={props.label} 
        required 
        value={props.value}
        onChange={(e) => props.change(e.target.value)} 
        />
    )}
    </div>
  )
}

export default TextBox
